import React, {useEffect} from "react";

import { Wrapper, Text, Price } from "./ingridientsdetailblockstyled";

export default function Index({ text, count, run, price }) {
  useEffect(() => {
    run();
  }, []);
  return (
    <Wrapper>
      <Text>{text}</Text>
      <Price>{price}грн.</Price>
    </Wrapper>
  );
}
